// SPDX-License-Identifier: MIT

// Recoge fondos de usuarios
// Te permite recoger esos fondos siendo el propietario del contrato
// Te permite establecer un valor mínimo para que te transfieran calculado en USD

pragma solidity ^0.8.8;

import "./PriceConverter.sol";

contract FundMe {
    using PriceConverter for uint256;
    // Con esta linea y gracias a la libreria estamos usando el uint256 como si fuese un objeto o una clase y así poder aplicarle funciones como por ejemplo msg.value.getConversionRate();

    uint256 public minimunUSD = 50 * 1e18; // 1e18 es lo mismo que 1 * 10 ** 18

    address[] public funders;
    // Hacemos un array para guardar las direcciones de todos los usuarios que han hecho transacciones
    mapping(address => uint256) public addressToAmountFunded;
    // Hacemos un mapping para ver la cantidad que ha transferido cada usuario del array de funders

    function fund() public payable {
    // Queremos establecer una cantidad mínima que nos tengan que ingresar en USD
    // 1. ¿Cómo mandar ETH a este contrato? 0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
    msg.value.getConversionRate(); // Es lo mismo que getConversionRate(msg.value)
       require(msg.value.getConversionRate() >= minimunUSD, "Didn't send enough!!!"); // Con esto estamos haciendo que como mínimo tengan que transferir 1ETH 
        // Lo que hay entre paréntesis: El primer argumento es para seleccionar la cantidad mínima, y el segundo argumento es para que en caso de que la sentencia "require" falle, aparezca el mensaje de error
        // 18 decimales
        funders.push(msg.sender);
        // Añadimos al array de funders, la dirección de cartera del usuario que realiza la transacción.
        addressToAmountFunded[msg.sender] = msg.value;
        // Aquí estamos creando la relación de la cantidad de ETH transferido asociao a cada cartera.

    }
}




