contracts/PriceConverter.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";


library PriceConverter {
    // Todas las funciones en una libreria tienen que ser internal

 function getPrice() internal view returns(uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        (,int256 price,,,) = priceFeed.latestRoundData();
        // Esto hace referencia al precio de ETH en USD
       return uint256(price * 1e10); // esto es parap poner los decimales ya que el precio nos lo da con decimales
    } 

    function getVersion() internal view returns (uint256) {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return priceFeed.version();
    }

    function getConversionRate(uint256 ethAmount) internal view returns (uint256) {
        // Esta funcion nos va a permitir cambiar el msg.value que viene en ETH, cambiarlo a USD
        uint256 ethPrice = getPrice();
        // Arriba estamos llamando a la funcion getPrice para así sacar el valor en tiempo real de ethereum
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18;
        // Y luego aquí estamos haciendo que para sacar los dólares, multiplicamos la cantidad de eth que tenemos por su precio y luego lo divimos para así sacar su precio en USD sin tantos decimales
        return ethAmountInUsd;
    }

}

